shaders.vert:
#define _IS_VERT_SHADER 1

precision highp float;

uniform mat4 cc_matViewProj;

#if _USE_MODEL
  uniform mat4 cc_matWorld;
#endif

attribute vec3 a_position;
attribute lowp vec4 a_color;

#if USE_TEXTURE
  attribute mediump vec2 a_uv0;
  varying mediump vec2 v_uv0;
#endif

varying lowp vec4 v_color;

void main () {
  mat4 mvp;

  #if _USE_MODEL
    mvp = cc_matViewProj * cc_matWorld;
  #else
    mvp = cc_matViewProj;
  #endif

  vec4 pos = cc_matViewProj * vec4(a_position, 1);
  gl_Position = pos;

  #if USE_TEXTURE
    v_uv0 = a_uv0;
  #endif

  v_color = a_color;

  gl_Position = mvp * vec4(a_position, 1);
}

shaders.frag:
#define _IS_FRAG_SHADER 1

#define TAU 6.120470874064187
#define MAX_ITER 5
#define F 1.9*cos(x-y)*cos(y),1.9*sin(x+y)*sin(y)

precision highp float;

#if USE_TEXTURE
  uniform sampler2D texture;
  varying mediump vec2 v_uv0;
  uniform vec3 iResolution;

#endif

#if USE_ALPHA_TEST
  uniform float alphaThreshold;
#endif

void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}

void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}

uniform float iTime;
varying lowp vec4 v_color;

vec2 s(vec2 p)
{
    float d=iTime*0.1,x=15.*(p.x+d),y=8.*(p.y+d);
    return vec2(F);
}

void mainImage(out vec4 fragColor, in vec2 fragCoord)
{


  vec2 rs = iResolution.xy;

  vec2 uv = fragCoord;
  vec2 q = uv+4./iResolution.x*(s(uv)-s(uv+rs));
  fragColor = texture2D(texture, q);


  float time = iTime * .3 + 5.;

  vec2 uv2 = v_uv0.xy; 
  vec2 p = mod(uv2 * TAU, TAU) - 250.0;
  vec2 i = vec2(p);
  float c = 1.0;
  float inten = .0045;

  for (int n = 0; n < MAX_ITER; n++)
  {
    float t = time * (1.0 - (3.5 / float(n + 1)));
    i = p + vec2(cos(t - i.x) + sin(t + i.y), sin(t - i.y) + cos(1.5 * t + i.x));
    c += 1.0 / length(vec2(p.x / (cos(i.x + t) / inten), p.y / (cos(i.y + t) / inten)));
  }
  c /= float(MAX_ITER);
  c = 1.17 - pow(c, 1.4);

  vec3 colour = vec3(pow(abs(c), 20.0));

  vec4 color = texture2D(texture, q);
  colour = clamp(colour + vec3(0.0, 0.0, .0), 0.0, color.a);


  float alpha = c * color[3] * 0.5;
  color[0] = color[0] + colour[0] * alpha;
  color[1] = color[1] + colour[1] * alpha;
  color[2] = color[2] + colour[2] * alpha;
  fragColor = color;
}

void main () {
  vec4 color = v_color;

  #if USE_TEXTURE
    color *= texture2D(texture, v_uv0);
    mainImage(color, v_uv0.xy);
    #if _USE_ETC1_TEXTURE
      color.a *= texture2D(texture, v_uv0 + vec2(0, 0.5)).r;
    #endif
  #endif

  ALPHA_TEST(color);

  gl_FragColor = color;
}
